measurements.description:
Thirty-seven starry flowers and five buds well arranged on three arching up to 70.2-cm inflorescences;


	 sepals and petals light chartreuse overlaid mahogany, striped and blotched darker mahogany mid-rib;
	lip creamy white, blushed light yellow centrally, side lobes spotted burgundy, mid lobe darker burgundy blotches;
	column creamy white blushed red-brown distally, anther cap white;	


    substance firm; texture matte.
